import React from "react";
import chevronDown from "../assets/images/Vector-down.svg"


import "../styles/Dropdown.css"
import EquipementList from "./Flat-equipement-list";

class Dropdown extends React.Component {

    render() {
        return <div className="dropdown" data-hidden="true" id="ingredients">
                <span class="dropdown__title">Fiabilité</span>
                <img class="dropdown__chevron-down" src={chevronDown} alt="dérouler les informations"/>
                <EquipementList FlatNumber="0" />
              </div>

    }
}

export default Dropdown
